import React from "react";
import './index.css'
import Logo from '../elements/logo/Logo.js';

const Navbox = () => (

    <svg width={226} height={1080} viewBox="0 0 226 1080" className="navbox">

      {/* Logo position */}
      <pattern
            id="c"
            preserveAspectRatio="xMidYMid slice"
            width="100%"
            height="100%"
            viewBox="0 0 1534 931"
          >
        <Logo />        
      </pattern>

  </svg>
);

export default Navbox;
